@EU_Commission @JunckerEU @ecb "Together, we showed that the euro is irreversible."
Sounds like a death trap.
Time to break free from it, it like will continue to get worse. The grip if the Eurocrates needs to be broken.

@EU_Commission 1. Taxes should be paid where performace (produce. work, sale, profit, revenue etc) comes from.
2. Global companies should pay as much tax (in %) in a country as much local small and medium-sized companies.
Fair and competitive-neutral tax system is essential.

@EU_Commission Still room for improvement for some countries. 
I wish there were highly scalable and sustainable solutions in #Germany for the #conversion and #storage of large amounts of #RenewableEnergy (#heat and #electricity). 
In my opinion, these are innovations that we urgently need.
